import React, {Component} from 'react';
import ReactDOM from 'react-dom';


// LifeCycle StateLess component

class App extends Component{
    render(){
        return(
            <div>
                <p>U clicked </p>
                <button>-1</button>
                <button onClick={this.add}>+1</button>
            </div>
        )
    }
}








ReactDOM.render(<App />, document.getElementById('root'));
